import React from "react";
import "./Trash.css";
import Profile from "./Profile";
import Header from "../Workplace/Header";
import trash from "../assets/trash.svg";
import arrow from "../assets/arrow.svg";
import { Popover, Menu } from "evergreen-ui";

function Profile_trash() {
    const menu = {
        height: "30px",
    };
    return (
        <div>
            <Header />
            <Profile />
            <div className="trash">
                <h2>Recently Deleted</h2>
                <p className="trash_p">
                    Workspace or space will automatically deleted from your Trash folder after 30 days.
                </p>
                <h2>My First Workspace</h2>
                <Popover
                    minWidth={120}
                    content={
                        <Menu>
                            <Menu.Group>
                                <Menu.Item style={menu} icon={<img src={trash} alt="" height="10" width="10" />}>
                                    <p className="menucontent">Restore workspace</p>
                                </Menu.Item>
                                <Menu.Item style={menu} icon={<img src={trash} alt="" height="10" width="10" />}>
                                    <p className="menucontent">Permanently delete</p>
                                </Menu.Item>
                            </Menu.Group>
                        </Menu>
                    }
                >
                    <div className="arrow_trash">
                        <img src={arrow} alt="" className="arrow" />
                    </div>
                </Popover>
            </div>
        </div>
    );
}

export default Profile_trash;
